import React from "react";
import Container from "@mui/material/Container";

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <Container
        maxWidth="sm"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "40vh",
          width: "40vh",
          backgroundColor: "red",
        }}
      >
        <Input placeholder="Type in here…" variant="soft" />
        <Input placeholder="Type in here…" variant="soft" />
      </Container>
    </Container>
  );
}
